import react from "react";
import "./ExpenseForm.css";

const ExpenseForm = () => {
  return (
    <form className="new-expense__controls">
      <div className="new-expense__control">
        <label>Title</label>
        <input type="text" />
      </div>
      <div className="new-expense__control">
        <label>Amount</label>
        <input type="text" />
      </div>
    </form>
  );
};

export default ExpenseForm;
